import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import reportWebVitals from './reportWebVitals';
import { bio } from './robot';

ReactDOM.render(
    <React.StrictMode>
        <div>
            {/*<Card id={bio[0].id} name={bio[0].name} email={bio[0].email}/>*/}
            {/*<Card id={bio[1].id} name={bio[1].name} email={bio[1].email}/>*/}
            {/*<Card id={bio[2].id} name={bio[2].name} email={bio[2].email}/>*/}
            {/*<Card id={bio[3].id} name={bio[3].name} email={bio[3].email}/>*/}
            {/*<Card id={bio[4].id} name={bio[4].name} email={bio[4].email}/>*/}
            <Card bio={bio}/>
        </div>

    </React.StrictMode>,
    document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
